function checkParts(array) {
    let completedParts = null; // send to port 1
    const incompleteParts = []; // send to port 2

    // group chunks by UUID
    const groupedParts = array.reduce((acc, obj) => {
        acc[obj.uuid] = acc[obj.uuid] || [];
        acc[obj.uuid].push(obj);
        return acc;
    }, {});

    for (const uuid in groupedParts) {
        const sameIdParts = groupedParts[uuid];
        const totalParts = sameIdParts[0].totalParts;
        const receivedParts = sameIdParts.map(part => part.part);

        if (receivedParts.length === totalParts &&
            receivedParts.every(part => receivedParts.includes(part))) {
            // only put first completed scan result in port 1, rest in port 2
            if (!completedParts) {
                completedParts = sameIdParts;
            } else {
                incompleteParts.push(sameIdParts);
            }
        } else {
            incompleteParts.push(sameIdParts);
        }
    }
    if (completedParts !== null) {
        node.send([{ payload: completedParts }, null, null]);
    }
    incompleteParts.forEach(sameIdParts => {
        sameIdParts.forEach(part => {
            const now = new Date().getTime();
            const timestamp = part.timestamp_utc;
            if (now - timestamp <= 3600000) { // 60min
                node.send([null, { payload: part }, null]);
            } else {
                const timeDiff = Math.floor(((now - timestamp) / 60000));
                const timeoutMsg = "Timeout for scan with uuid " + part.uuid + " in room " + part.room + ", parts incomplete after " + timeDiff + "min";
                node.send([null, null, { payload: timeoutMsg }]);
            }
        });
    });
    node.done();
}

