function calculateAvgRSSI(data) {
    // Sort data by time
    data.sort((a, b) => a.time - b.time);
    const avgRSSI = {};

    data.forEach(entry => {
        const time = entry.time;
        const rssi = entry.rssi;

        if (!avgRSSI[time]) {
            avgRSSI[time] = { sum: 0, count: 0 };
        }

        avgRSSI[time].sum += rssi;
        avgRSSI[time].count++;
    });

    const avgRSSIData = Object.entries(avgRSSI).map(([time, { sum, count }]) => {
        return { x: parseInt(time), y: sum / count };
    });

    const output = [{
        series: ["Avg. rssi"],
        data: [avgRSSIData],
        labels: ["RSSI"]
    }];

    return output;
}

